import React from "react";

function MyGigs() {
  return (
    <div>
      {gigs &&
        gigs.map((gig) => (
          <Card
            key={gig.id}
            id={gig.id}
            title={gig.title}
            city={gig.city}
            desc={gig.desc}
            rate={gig.rate}
            schedule={gig.schedule}
            startDate={gig.startDate}
          />
        ))}
    </div>
  );
}

export default MyGigs;
